import React, { Component } from 'react'
import { StyleSheet,Text,View,ScrollView } from 'react-native';
import {NavigationContainer} from '@react-navigation/native';
import { createStackNavigator } from 'react-navigation-stack';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

const Stack = createNativeStackNavigator();



export default class InfoScreen extends Component {
  render() {
    return (

      <ScrollView>

      <View style={{ flex: 1, alignItems: 'center', justifyContent: 'top' }}> 



        <Text style={{fontWeight: 'bold'}}>Terminos y condiciones</Text> {"\n"}

        <Text style={{textDecorationLine:'underline'}}>Política de compra</Text>
        <Text >


        Si desea comprar sin bordado lo puede realizar atraves del sitio web ,correo elctronico , redes sociales y si desea con bordado debe solicitar una cotización de a lo menos 10 prendas en su primera compra , luego podrá comprar por prenda. Políticas de cambio y devolución para e-commerce EL DESCUEVEE En caso de falla del producto, este se encuentra amparado por la garantía legal, consisten en el derecho a optar a la devolución del dinero, el cambio o la reparación del producto, durante los tres primeros meses desde la fecha de recepción. Para hacer efectiva la garantía del producto, así como los cambios de productos adquiridos por medio del sitio web, los clientes que se encuentren en la Región Metropolitana podrán dirigirse a nuestra sucursal ubicada en Cerro La Campana #1095, comuna de Pudahuel. (Debido a la emergencia sanitaria en la que nos encontramos, este punto queda suspendido hasta nuevo aviso, cualquier duda o consulta, escribir o llamar a los números que se indican a continuación). La garantía se hará efectiva siempre y cuando se cumplan con las indicaciones señaladas en este documento En caso de dudas o sugerencias, agradeceremos escribir al correo electrónico contacto@eldescuevee.cl, o bien comunicarse a cualquiera de nuestros teléfonos: +56 9 39266110 / +56 9 39266109 (horario de atención de Lunes a Viernes de 9:00 a 18:00 hrs.) Requisitos para realizar Cambios de compras realizadas por Internet: Solicitarlo dentro del plazo legal. La devolución tendrá lugar siempre que éste no se hubiere deteriorado por un hecho imputable al consumidor. (Art. 21, Ley 19.496). El producto debe estar sin uso, con sus etiquetas y en perfectas condiciones. Debe disponer del embalaje original. Debe presentar la boleta, las órdenes de compra impresas no son válidas como documento. No debe estar bordado Requisitos para realizar Devoluciones de compras realizadas por Internet. Puedes solicitar devolución si el producto en caso que presente fallas de fabricación o bien no cumpla con las características anunciadas (ejemplo: color, medidas, accesorios). En caso de ser necesario se le solicitarán fotografías del producto que evidencien algún posible problema. Esta alternativa se encontrará disponible exclusivamente para personas que hayan realizado la compra de manera no presencial a través de internet, debiendo cumplir con las siguientes condiciones: Solicitarlo dentro del plazo legal, siempre que éste no se hubiere deteriorado por hecho imputable al consumidor. (Art. 21, Ley 19.496). El producto debe estar sin uso, con etiquetas y en perfectas condiciones. Debe disponer del embalaje original. Debe presentar la boleta, las órdenes de compra impresas no son válidas como documento. No debe estar bordado Las devoluciones de dinero variarán dependiendo del medio de pago utilizado al realizar la compra. Si el pago fue efectuado con tarjeta de débito, la devolución se realizará mediante una transferencia bancaria. Si el pago fue efectuado mediante tarjeta de crédito, se realizará la anulación en su tarjeta. Se deja expresa constancia y el consumidor declara conocer y aceptar que el tiempo que la devolución se encuentra en trámite ante la correspondiente entidad bancaria escapa al control de EL DESCUEVEE, por lo que dichos plazos podrían variar. No obstante se garantiza que, una vez recibida la solicitud de devolución EL DESCUEVEE la procesará de la manera más rápida posible, estimándose un plazo de 20 días corridos para recibir, procesar la devolución y generar el depósito en la cuenta bancaria que se señale. Una vez recibidos y procesados los productos devueltos, se enviará una notificación al correo electrónico que se señale al efecto. Todos los plazos señalados en este párrafo serán contados desde que la devolución haya sido solicitada vía email o teléfono.

        </Text>

       <Text style={{textDecorationLine:'underline'}}>Términos y condiciones de despachos</Text>
      <Text >
    Actualmente, nuestro ecommerce EL DESCUEVEE se encuentra habilitado para despachar a todo Chile continental, mediante diferentes transportes y empresas de envíos. Despachos dentro del Gran Santiago: Los envíos dentro del Gran Santiago serán despachados lunes, miércoles y viernes. Si el pedido lo realizaste antes de las 11:00 am, será despachado el mismo día. Si fue realizado después de las 11:00 horas, será despachado el siguiente día hábil. En el caso de que sea necesario un envío especial (aplicable a regalos) deberá ser informado en el carrito de compras, en la sección “Introduzca las instrucciones especiales para su pedido”, indicando el día que se requiere el envío, exceptuándose el día domingo, día en el cual no se realizará ningún tipo de despacho. Para esta área, trabajamos con nuestro propio despacho tenemos cobertura en las siguientes comunas: Cerrillos Lo Barnechea (*) Quilicura Cerro Navia Lo Espejo Quinta Normal Conchalí Lo Prado Recoleta El Bosque Macul Renca Estación Central Maipú San Bernardo Huechuraba Ñuñoa San Joaquín Independencia Pedro Aguirre Cerda San Miguel La Cisterna Peñalolén San Ramón La Florida Providencia Santiago La Granja Pudahuel (**) Vitacura Las Condes Puente Alto (*) Límite para Lo Barnechea: Excluye Camino a Farellones. (**) Límite para Pudahuel: hasta Ciudad de los Valles. Regiones y Provincias: Los envíos que se realizan a regiones y provincias serán realizados bajo la modalidad “por pagar”, lo que significa que al momento de recibir el producto, el cliente (que lo recepciona) paga el total del despacho. Estos envíos serán realizados por Chilexpress, Correos de Chile o Starken*. Los pedidos se despacharán en 48 horas hábiles desde Santiago y se enviará, mediante correo electrónico el número de seguimiento correspondiente. La fecha de entrega del producto, dependerá exclusivamente del Courier por el cual se realizó el envío, no cabiéndole responsabilidad alguna a el descuevee en ello. Provincias incluyen a: Alhué La Pintana Pirque Buin Lampa San José de Maipo Calera de Tango María Pinto San Pedro Colina Melipilla Talagante Curacaví Padre Hurtado Til Til El Monte Paine Isla de Maipo Peñaflor (*) Starken es el único Courier que hace envíos por pagar a domicilio. Direcciones de envío: El cliente se compromete a indicar la dirección exacta a la que debe ser despachada la compra, ya sea domicilio o en una sucursal de envíos (Chilexpress, Starken, etc) e indicar las instrucciones especiales que sean necesarias al final del pedido, tales como: que lo llamen cuando haya llegado el pedido, tocar el timbre, dejar en conserjería, etc. Si la compra realizada la fuere para una persona distinta del comprador, se deberá indicar en el cuadro de “instrucciones especiales para su pedido” y completar correctamente la dirección de envío, de modo tal de evitar posibles errores.

      </Text >

       <Text style={{textDecorationLine:'underline'}}>Uso de la información en convenios con El descuevee</Text>

      <Text >
Mediante el envío de esta información, el usuario autoriza expresamente a EL DESCUEVEE o al responsable de la base de datos que específicamente se indique a tratar sus datos personales, incluso aquellos relativos a la salud, en la medida en que sean necesarios para proveer servicios, el cumplimiento y mantenimiento de las relaciones existentes entre las partes así como, en su caso, el envío, por cualquier medio incluidos los electrónicos, de publicidad u otras ofertas, relacionadas con productos y servicios financieros, de seguros, socio-sanitarios y/o de salud o bienestar, que pudieran resultar de su interés de la entidad, empresas relacionadas (EL DESCUEVEE) y terceros con los que establezca vínculos de colaboración, autorizando el usuario a dicha entidad responsable a tratar sus datos para enviarle la información que más se adapte a sus necesidades específicas. 
      </Text >



      </View>

      </ScrollView>

    )
  }
}
